import IncomeSum from "./IncomeSum";
import ExpensesSum from "./ExpensesSum";
import "./Header.css";

const Header = () => {
  return (
    <div>
      <header>
        <div className="header">
          <div className="header__container">
            <p>Available Budget</p>
            <h1>+1000.00</h1>
            <IncomeSum />
            <ExpensesSum />
          </div>
        </div>
      </header>
    </div>
  );
};

export default Header;
